import React, { Component } from "react";
import AccountCircle from "@material-ui/icons/AccountCircle";
import LockIcon from "@material-ui/icons/Lock";
import Link from "@material-ui/core/Link";
import InputAdornment from "@material-ui/core/InputAdornment";
import {
  Typography,
  withStyles,
  TextField,
  Button,
  CssBaseline,
  Container
} from "@material-ui/core";

import style from "./style";

class Layout extends Component {
  render() {
    const { classes } = this.props;
    return (
      // <div className={classes.container}>
      //   <Typography variant='h5'>Login Screen</Typography>
      // </div>
      <Container maxWidth="xs">
        <CssBaseline />
        <div className={classes.container}>
          {/* <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar> */}
          <div>
            <img src="/public/images/logo.png.png" className={classes.image} />
          </div>
          <Typography
            component="h1"
            variant="h5"
            className={classes.Typography}
          >
            Sign In
          </Typography>
          <form className={classes.from} noValidate>
            <TextField
              className={classes.textField}
              margin="normal"
              fullWidth
              variant="outlined"
              placeholder="Enter Your email"
              autoComplete="email"
              InputProps={{
                startAdornment: (
                  <InputAdornment className={classes.svg} position="start">
                    <AccountCircle />
                  </InputAdornment>
                )
              }}
            />

            <TextField
              className={classes.textField}
              margin="normal"
              fullWidth
              type="password"
              variant="outlined"
              placeholder="Enter Your Password"
              InputProps={{
                startAdornment: (
                  <InputAdornment className={classes.svg} position="start">
                    <LockIcon />
                  </InputAdornment>
                )
              }}
            />

            <Button
              type="submit"
              fullWidth
              variant="contained"
              className={classes.btnsubmit}
            >
              Sign In
            </Button>
            <Link href="Signup" variant="body2" className={classes.forget}>
              {"New to Stayin?  Sign Up"}
            </Link>
          </form>
        </div>
      </Container>
    );
  }
}

export default withStyles(style)(Layout);
